            var desc: sg.GlslShaderUniform = .{};
            desc.type = .FLOAT;
            desc.array_count = 0;
            desc.glsl_name = "text_unit_range";
            return desc;
        }
        if (std.mem.eql(u8, u_name, "text_in_bias")) {
            var desc: sg.GlslShaderUniform = .{};
            desc.type = .FLOAT;
            desc.array_count = 0;
            desc.glsl_name = "text_in_bias";
